import React from "react";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import newImage from "../assets/newImage.png";

function Weather() {
  const reducerData = useSelector((state) => state);
  console.log(reducerData);
  console.log(reducerData.travelNewsData);
  console.log(reducerData.travelRecreationalData);
  console.log(reducerData.travelWeatherData);
  return (
    <div
      className='hero'
      style={{
        backgroundImage: `url(${newImage})`,
      }}
    >
      <div>
        <div>
          <h1 className='destination__name'>{reducerData.destinationName}</h1>
          {reducerData.travelNewsData.slice(0, 5).map((data, index) => {
            return (
              <div key={index}>
                <Link to={`/weather/${data.title}`}>
                  <h2>{data.title}</h2>
                </Link>
                {/* <p>{data.description.slice(0, 25)}</p> */}
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default Weather;
